import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ConfigPage from './pages/ConfigPage';
import OrdersPage from './pages/OrdersPage';

const App: React.FC = () => {
  return (
    <Router>
      <div className="bg-red-500 p-4 text-white font-poppins shadow-md rounded-lg m-4">
        Tailwind CSS est√° funcionando si ves este texto en un fondo rojo con la fuente Poppins, sombra, y bordes redondeados.
      </div>
      <Routes>
        <Route path="/" element={<ConfigPage />} />
        <Route path="/orders" element={<OrdersPage />} />
      </Routes>
    </Router>
  );
};

export default App;
